import React, { useState } from 'react';
import '../styles/Contact.css';

function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    subject: '',
    message: ''
  });

  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    // 模拟提交
    setTimeout(() => {
      setIsSubmitting(false);
      alert('消息已发送！我们会尽快与您联系。');
      setFormData({
        name: '',
        email: '',
        phone: '',
        subject: '',
        message: ''
      });
    }, 2000);
  };

  return (
    <div className="contact-page">
      <div className="contact-hero">
        <h1>联系我们</h1>
        <p>随时为您提供帮助</p>
      </div>

      <div className="contact-content">
        <div className="contact-info">
          <div className="info-card">
            <div className="info-icon">📍</div>
            <h3>地址</h3>
            <p>北京市朝阳区XX大厦</p>
          </div>
          <div className="info-card">
            <div className="info-icon">📞</div>
            <h3>电话</h3>
            <p>400-123-4567</p>
          </div>
          <div className="info-card">
            <div className="info-icon">✉️</div>
            <h3>邮箱</h3>
            <p>contact@travel.com</p>
          </div>
        </div>

        <div className="contact-form-container">
          <form className="contact-form" onSubmit={handleSubmit}>
            <div className="form-group">
              <div className="input-container">
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                  required
                  className="input-field"
                />
                <label className="input-label">姓名</label>
              </div>
            </div>

            <div className="form-group">
              <div className="input-container">
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  required
                  className="input-field"
                />
                <label className="input-label">邮箱</label>
              </div>
            </div>

            <div className="form-group">
              <div className="input-container">
                <input
                  type="tel"
                  name="phone"
                  value={formData.phone}
                  onChange={handleChange}
                  required
                  className="input-field"
                />
                <label className="input-label">电话</label>
              </div>
            </div>

            <div className="form-group">
              <div className="input-container">
                <input
                  type="text"
                  name="subject"
                  value={formData.subject}
                  onChange={handleChange}
                  required
                  className="input-field"
                />
                <label className="input-label">主题</label>
              </div>
            </div>

            <div className="form-group">
              <div className="input-container">
                <textarea
                  name="message"
                  value={formData.message}
                  onChange={handleChange}
                  required
                  className="input-field textarea"
                  rows="5"
                ></textarea>
                <label className="input-label">留言内容</label>
              </div>
            </div>

            <button
              type="submit"
              className={`submit-button ${isSubmitting ? 'loading' : ''}`}
              disabled={isSubmitting}
            >
              {isSubmitting ? (
                <div className="loading-spinner"></div>
              ) : (
                '发送消息'
              )}
            </button>
          </form>
        </div>

        <div className="map-container">
          <h2>我们的位置</h2>
          <div className="map-placeholder">
            <iframe
              src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d12345.67890!2d116.4!3d39.9!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x0!2zMznCsDU0JzM2LjAiTiAxMTbCsDI0JzM2LjAiRQ!5e0!3m2!1sen!2sus!4v1234567890"
              width="100%"
              height="450"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              referrerPolicy="no-referrer-when-downgrade"
            ></iframe>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
